<script lang="ts">

import { defineComponent } from 'vue'

interface dataProperties {
  defaultImage: string | ArrayBuffer | null
  originalImage: string | ArrayBuffer | null
  palindromicImg: string | ArrayBuffer | null
  palindromicImage: string | ArrayBuffer | null
}

export default defineComponent({
  name: 'ImagePalindrome',
  data(): dataProperties {
    return {
      defaultImage: 'data:image/jpeg;base64,',
      originalImage: null,
      palindromicImg: null,
      palindromicImage: null
    }
  },
  methods: {
    handleChange(e: any) {
      const reader = new FileReader();

      reader.readAsDataURL(e[0]);
      reader.onload = (onloadEvent) => {
        if (onloadEvent && onloadEvent.target) {
          this.originalImage = onloadEvent.target.result
          console.log(this.originalImage as string)
        }
      };
    },
    reset() {
      this.originalImage = null;
      this.palindromicImage = null;
    },
    run() {
      console.log("generating palindromic image")
      if (!this.originalImage) {
        // TODO: Show error message
        console.log("no img loaded")
        this.originalImage = this.defaultImage
      }

      const img = new Image();
      img.src = this.originalImage as string;
      const canvas = this.$refs.originalImage as HTMLCanvasElement;
      const canvasPalindromic = this.$refs.palindromicImage as HTMLCanvasElement;
      const ctx = canvas.getContext('2d');

      if (!ctx) {
        // TODO: Show error message
        console.log("no ctx")
        return;
      }

      const setPalindromicImage = (imageDate: string) => {
        this.palindromicImage = imageDate
      }

      img.onload = function() {
        const imageWidth = Math.max(500, img.width)
        const imageHeight = (imageWidth * img.height) / img.width

        console.log('origin image size', img.width, img.height)
        console.log('image size', imageWidth, imageHeight)

        canvas.width = imageWidth
        canvasPalindromic.width = imageWidth
        canvas.height = imageHeight
        canvasPalindromic.height = imageHeight

        ctx.drawImage(img, 0, 0);

        var imageData = ctx.getImageData(0,0, canvas.width, canvas.height)

        for (let i = 0; i < imageData.data.length; i += 4) {
          imageData.data[i] = 255 - imageData.data[i];
          imageData.data[i+1] = 255 - imageData.data[i+1];
          imageData.data[i+2] = 255 - imageData.data[i+2];
        }

        const ctxEdited = canvasPalindromic.getContext('2d');
        if (ctxEdited) {
          ctxEdited.putImageData(imageData, 0, 0);
          setPalindromicImage(canvasPalindromic.toDataURL())
        }
      };
    }
  }
})
</script>

<template>
  <div>
    <div>
      <span v-if="originalImage == null">No image uploaded</span>
      <div v-else>
        <NuxtImg
            :src="originalImage"
        />
      </div>
    </div>

    <div class="mt-4 space-y-2">
      <UInput
          type="file"
          size="md"
          accept="image/*"
          name="fileInput"
          @change="handleChange"

      />

      <div class="flex space-x-3">
        <UButton color="primary" variant="solid" @click="run">Generate Palindromic Image</UButton>
        <UButton color="red" variant="solid" @click="reset">Reset</UButton>

      </div>

    </div>

    <div class="mt-8 flex space-x-2">
      <canvas ref="originalImage" class="hidden"></canvas>
      <canvas ref="palindromicImage" class="hidden"></canvas>

      <div>
        <span v-if="palindromicImage == null">No image processed</span>
        <div v-else>
          <NuxtImg
              :src="palindromicImage"
          />
        </div>
      </div>
    </div>

  </div>
</template>

